int sum = 0;
for (int i = 1; i <= 3; i++) {
 sum = sum + 1;
}
System.out.println(sum);

int count = 1;
for (int i = 0; i < 2; i++) {
 count *= 2;
}
System.out.println(count);

int x = 0;
for (int i = 0; i < 3; i++) {
 x++;
}
System.out.println(x);

for (int i = 1; i < 5; i++) {
 if (i == 3) break;
 System.out.print(i);
}

for (int i = 0; i < 5; i++) {
 if (i % 2 == 0) continue;
 System.out.print(i);
}

int total = 0;
for (int i = 1; i < 4; i++) {
 total += i;
}
System.out.println(total);

for (int k = 5; k > 0; k--) {
 if (k == 3) continue;
 System.out.print(k);
}

int y = 1;
for (int i = 0; i < 3; i++) {
 y *= 2;
}
System.out.println(y);

int x = 0;
for (int i = 1; i <= 4; i *= 2) {
 x++;
}
System.out.println(x);

int sum = 0;
for (int i = 10; i > 0; i -= 3) {
 sum++;
}
System.out.println(sum);

int count = 10;
for (int i = 0; i < 2; i++) {
 count /= 2;
}
System.out.println(count);

int total = 0;
for (int i = 0; i < 5; i += 2) {
 total += i;
}
System.out.println(total);

int x = 10;
for (int i = 0; i < 3; i++) {
 x--;
}
System.out.println(x);

int sum = 0;
for (int i = 1; i <= 5; i += 2) {
 sum += i;
}
System.out.println(sum);

int a = 10;
for (int i = 0; i < 1; i++) {
